import React, { useState } from "react";
import { useLocation } from "react-router-dom";
import { createTheme, ThemeProvider } from "@mui/material/styles";
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
import Container from "@mui/material/Container";
import CssBaseline from "@mui/material/CssBaseline";
import Avatar from "@mui/material/Avatar";
import Button from "@mui/material/Button";
import Link from "@mui/material/Link";
import Checkbox from "@mui/material/Checkbox";
import FormControlLabel from "@mui/material/FormControlLabel";
import TextField from "@mui/material/TextField";
import FormControl from "@mui/material/FormControl";
import { FormGroup } from "@mui/material";

// import NewOrderItemForm from "./NewOrderItemForm";

function Copyright(props) {
  return (
    <Typography
      variant="body2"
      color="text.secondary"
      align="center"
      {...props}
    >
      {"Copyright © "}
      <Link color="inherit" href="https://mui.com/">
        Pantry
      </Link>{" "}
      {new Date().getFullYear()}
      {"."}
    </Typography>
  );
}

function NewOrderForm(props) {
  const location = useLocation();
  const food = props.food;
  const order = location.state.params;
  // let date = order.date.toString().slice(0, 10);
  // console.log(date);

  const initialCheckState = {
    blackBeans: false,
    cereal: false,
    chickPeas: false,
    chicken: false,
    // "chickenFort": false,
    chili: false,
    cookies: false,
    corn: false,
    fruit: false,
    greenBeans: false,
    hash: false,
    jello: false,
    jelly: false,
    macCheese: false,
    mayo: false,
    milk: false,
    pasta: false,
    pastaSauce: false,
    peanutButter: false,
    peas: false,
    porkBeans: false,
    redBeans: false,
    saltines: false,
    soup: false,
    stew: false,
    tuna: false,
    whiteRice: false,
  };

  const initialState = {
    blackBeans: "",
    cereal: "",
    chickPeas: "",
    chicken: "",
    // "chickenFort": false,
    chili: "",
    cookies: "",
    corn: "",
    fruit: "",
    greenBeans: "",
    hash: "",
    jello: "",
    jelly: "",
    macCheese: "",
    mayo: "",
    milk: "",
    pasta: "",
    pastaSauce: "",
    peanutButter: "",
    peas: "",
    porkBeans: "",
    redBeans: "",
    saltines: "",
    soup: "",
    stew: "",
    tuna: "",
    whiteRice: "",
  };

  const [checked, setChecked] = useState(initialCheckState);
  const [formErrors, setFormErrors] = useState([]);
  const [formData, setFormData] = useState(initialState);

  const {
    blackBeans,
    cereal,
    chickPeas,
    chicken,
    milk,
    pasta,
    pastaSauce,
    soup,
    stew,
    hash,
    chili,
    porkBeans,
    redBeans,
    greenBeans,
    corn,
    peas,
    fruit,
    macCheese,
    whiteRice,
    peanutButter,
    jelly,
    tuna,
    mayo,
    cookies,
    saltines,
    jello,
  } = checked;

  const pantryTheme = createTheme();

  const handleCheckChange = (event) => {
    setChecked({ ...checked, [event.target.name]: event.target.checked });
  };

  const handleChange = (evt) => {
    const { name, value } = evt.target;
    setFormData((data) => ({
      ...data,
      [name]: value,
    }));
  };

  async function handleSubmit(event) {
    event.preventDefault();
    return null;
    // let client = await PantryApi.addClient(formData);

    // if (client) {
    //   history.push("/clients");
    // } else {
    //   setFormErrors(client.err);
    // }
  }

  return (
    <ThemeProvider theme={pantryTheme}>
      <Container component="main" maxWidth="xs">
        <CssBaseline />
        <Box
          sx={{
            marginTop: 8,
            display: "flex",
            flexDirection: "column",
            alignItems: "center",
          }}
        >
          <Avatar sx={{ m: 1, bgcolor: "secondary.main" }}>
            <span className="material-symbols-outlined">nutrition</span>
          </Avatar>
          <Typography component="h1" variant="h5" sx={{ textAlign: "center" }}>
            Pantry Menu
          </Typography>
          <Typography component="h2" sx={{ textAlign: "center" }}>
            {/* {date} */}
          </Typography>
          <Typography component="h3" sx={{ textAlign: "center" }}>
            Clients can choose up to 12 items. Limit of 2 per item, except where
            noted.
          </Typography>
          <Box
            component="form"
            onSubmit={handleSubmit}
            noValidate
            sx={{ mt: 1 }}
          >
            <FormGroup aria-label="position" row>
              <Box sx={{ display: "flex", flexDirection: "row" }}>
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={chicken}
                      id="chicken"
                      name="chicken"
                      onChange={handleCheckChange}
                      // value={formData.firstName}
                    />
                  }
                  label="Chicken"
                />
                {checked.chicken ? (
                  <TextField
                    margin="normal"
                    fullWidth
                    id="chicken"
                    name="chickenQuantity"
                    label="# Chicken"
                    onChange={handleChange}
                    value={formData.chicken}
                    autoFocus
                  />
                ) : (
                  ""
                )}
              </Box>
            </FormGroup>

            <FormGroup aria-label="position" row>
              <Box sx={{ display: "flex", flexDirection: "row" }}>
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={chickPeas}
                      id="chickPeas"
                      name="chickPeas"
                      onChange={handleCheckChange}
                    />
                  }
                  label="Chick Peas"
                />

                {checked.chickPeas ? (
                  <TextField
                    margin="normal"
                    fullWidth
                    id="chickPeas"
                    name="chickPeas"
                    label="# Chick Peas"
                    onChange={handleChange}
                    value={formData.chickPeas}
                  />
                ) : (
                  ""
                )}
              </Box>
            </FormGroup>

            <FormGroup aria-label="position" row>
              <Box sx={{ display: "flex", flexDirection: "row" }}>
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={cereal}
                      id="cereal"
                      name="cereal"
                      onChange={handleCheckChange}
                    />
                  }
                  label="Cereal"
                />

                {checked.cereal ? (
                  <TextField
                    margin="normal"
                    fullWidth
                    id="cereal"
                    name="cereal"
                    label="# Cereal"
                    onChange={handleChange}
                    value={formData.cereal}
                  />
                ) : (
                  ""
                )}
              </Box>
            </FormGroup>

            <FormGroup aria-label="position" row>
              <Box sx={{ display: "flex", flexDirection: "row" }}>
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={milk}
                      id="milk"
                      name="milk"
                      onChange={handleCheckChange}
                    />
                  }
                  label="Milk"
                />

                {checked.milk ? (
                  <TextField
                    margin="normal"
                    fullWidth
                    id="milk"
                    name="milk"
                    label="# Milk"
                    onChange={handleChange}
                    value={formData.milk}
                  />
                ) : (
                  ""
                )}
              </Box>
            </FormGroup>

            <FormGroup aria-label="position" row>
              <Box sx={{ display: "flex", flexDirection: "row" }}>
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={pastaSauce}
                      id="pastaSauce"
                      name="pastaSauce"
                      onChange={handleCheckChange}
                    />
                  }
                  label="Pasta Sauce"
                />
                {checked.pastaSauce ? (
                  <TextField
                    margin="normal"
                    fullWidth
                    id="pastaSauce"
                    name="pastaSauce"
                    label="# Pasta Sauce"
                    onChange={handleChange}
                    value={formData.pastaSauce}
                  />
                ) : (
                  ""
                )}
              </Box>
            </FormGroup>

            <FormGroup aria-label="position" row>
              <Box sx={{ display: "flex", flexDirection: "row" }}>
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={pasta}
                      id="pasta"
                      name="pasta"
                      onChange={handleCheckChange}
                    />
                  }
                  label="Pasta"
                />
                {checked.pasta ? (
                  <TextField
                    margin="normal"
                    fullWidth
                    id="pasta"
                    name="pasta"
                    label="# Pasta"
                    onChange={handleChange}
                    value={formData.pasta}
                  />
                ) : (
                  ""
                )}
              </Box>
            </FormGroup>

            <FormGroup aria-label="position" row>
              <Box sx={{ display: "flex", flexDirection: "row" }}>
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={soup}
                      id="soup"
                      name="soup"
                      onChange={handleCheckChange}
                    />
                  }
                  label="Soup"
                />
                {checked.soup ? (
                  <TextField
                    margin="normal"
                    fullWidth
                    id="soup"
                    name="soup"
                    label="# Soup"
                    onChange={handleChange}
                    value={formData.soup}
                  />
                ) : (
                  ""
                )}
              </Box>
            </FormGroup>

            <FormGroup aria-label="position" row>
              <Box sx={{ display: "flex", flexDirection: "row" }}>
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={stew}
                      id="stew"
                      name="stew"
                      onChange={handleCheckChange}
                    />
                  }
                  label="Stew"
                />
                {checked.stew ? (
                  <TextField
                    margin="normal"
                    fullWidth
                    id="stew"
                    name="stew"
                    label="# Stew"
                    onChange={handleChange}
                    value={formData.stew}
                  />
                ) : (
                  ""
                )}
              </Box>
            </FormGroup>

            <FormGroup aria-label="position" row>
              <Box sx={{ display: "flex", flexDirection: "row" }}>
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={hash}
                      id="hash"
                      name="hash"
                      onChange={handleCheckChange}
                    />
                  }
                  label="Hash"
                />
                {checked.hash ? (
                  <TextField
                    margin="normal"
                    fullWidth
                    id="hash"
                    name="hash"
                    label="# Hash"
                    onChange={handleChange}
                    value={formData.hash}
                  />
                ) : (
                  ""
                )}
              </Box>
            </FormGroup>

            <FormGroup aria-label="position" row>
              <Box sx={{ display: "flex", flexDirection: "row" }}>
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={chili}
                      id="chili"
                      name="chili"
                      onChange={handleCheckChange}
                    />
                  }
                  label="Chili"
                />
                {checked.chili ? (
                  <TextField
                    margin="normal"
                    fullWidth
                    id="chili"
                    name="chili"
                    label="# Chili"
                    onChange={handleChange}
                    value={formData.chili}
                  />
                ) : (
                  ""
                )}
              </Box>
            </FormGroup>

            <FormGroup aria-label="position" row>
              <Box sx={{ display: "flex", flexDirection: "row" }}>
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={porkBeans}
                      id="porkBeans"
                      name="porkBeans"
                      onChange={handleCheckChange}
                    />
                  }
                  label="Pork & Beans"
                />
                {checked.porkBeans ? (
                  <TextField
                    margin="normal"
                    fullWidth
                    id="porkBeans"
                    name="porkBeans"
                    label="# Pork & Beans"
                    onChange={handleChange}
                    value={formData.porkBeans}
                  />
                ) : (
                  ""
                )}
              </Box>
            </FormGroup>

            <FormGroup aria-label="position" row>
              <Box sx={{ display: "flex", flexDirection: "row" }}>
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={chickPeas}
                      id="chickPeaks"
                      name="chickPeas"
                      onChange={handleCheckChange}
                    />
                  }
                  label="Chick Peas"
                />
                {checked.chickPeas ? (
                  <TextField
                    margin="normal"
                    fullWidth
                    id="chickPeas"
                    name="chickPeas"
                    label="#Chick Peas"
                    onChange={handleChange}
                    value={formData.chickPeas}
                  />
                ) : (
                  ""
                )}
              </Box>
            </FormGroup>

            <FormGroup aria-label="position" row>
              <Box sx={{ display: "flex", flexDirection: "row" }}>
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={redBeans}
                      id="redBeans"
                      name="redBeans"
                      onChange={handleCheckChange}
                    />
                  }
                  label="Red Beans"
                />
                {checked.redBeans ? (
                  <TextField
                    margin="normal"
                    fullWidth
                    id="redBeans"
                    name="redBeans"
                    label="# Red Beans"
                    onChange={handleChange}
                    value={formData.redBeans}
                  />
                ) : (
                  ""
                )}
              </Box>
            </FormGroup>

            <FormGroup aria-label="position" row>
              <Box sx={{ display: "flex", flexDirection: "row" }}>
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={greenBeans}
                      id="greenBeans"
                      name="greenBeans"
                      onChange={handleCheckChange}
                    />
                  }
                  label="Green Beans"
                />
                {checked.greenBeans ? (
                  <TextField
                    margin="normal"
                    fullWidth
                    id="greenBeans"
                    name="greenBeans"
                    label="# Green Beans"
                    onChange={handleChange}
                    value={formData.greenBeans}
                  />
                ) : (
                  ""
                )}
              </Box>
            </FormGroup>

            <FormGroup aria-label="position" row>
              <Box sx={{ display: "flex", flexDirection: "row" }}>
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={corn}
                      id="corn"
                      name="corn"
                      onChange={handleCheckChange}
                    />
                  }
                  label="Corn"
                />
                {checked.corn ? (
                  <TextField
                    margin="normal"
                    fullWidth
                    id="corn"
                    name="corn"
                    label="# Corn"
                    onChange={handleChange}
                    value={formData.corn}
                  />
                ) : (
                  ""
                )}
              </Box>
            </FormGroup>

            <FormGroup aria-label="position" row>
              <Box sx={{ display: "flex", flexDirection: "row" }}>
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={peas}
                      id="peas"
                      name="peas"
                      onChange={handleCheckChange}
                    />
                  }
                  label="Peas"
                />
                {checked.peas ? (
                  <TextField
                    margin="normal"
                    fullWidth
                    id="peas"
                    name="peas"
                    label="# Peas"
                    onChange={handleChange}
                    value={formData.peas}
                  />
                ) : (
                  ""
                )}
              </Box>
            </FormGroup>

            <FormGroup aria-label="position" row>
              <Box sx={{ display: "flex", flexDirection: "row" }}>
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={fruit}
                      id="fruit"
                      name="fruit"
                      onChange={handleCheckChange}
                    />
                  }
                  label="Fruit"
                />
                {checked.fruit ? (
                  <TextField
                    margin="normal"
                    fullWidth
                    id="fruit"
                    name="fruit"
                    label="# Fruit"
                    onChange={handleChange}
                    value={formData.fruit}
                  />
                ) : (
                  ""
                )}
              </Box>
            </FormGroup>

            <FormGroup aria-label="position" row>
              <Box sx={{ display: "flex", flexDirection: "row" }}>
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={macCheese}
                      id="macCheese"
                      name="macCheese"
                      onChange={handleCheckChange}
                    />
                  }
                  label="Mac & Cheese"
                />
                {checked.macCheese ? (
                  <TextField
                    margin="normal"
                    fullWidth
                    id="macCheese"
                    name="macCheese"
                    label="# Mac & Cheese"
                    onChange={handleChange}
                    value={formData.macCheese}
                  />
                ) : (
                  ""
                )}
              </Box>
            </FormGroup>

            <FormGroup aria-label="position" row>
              <Box sx={{ display: "flex", flexDirection: "row" }}>
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={whiteRice}
                      id="whiteRice"
                      name="whiteRice"
                      onChange={handleCheckChange}
                    />
                  }
                  label="White Rice"
                />
                {checked.whiteRice ? (
                  <TextField
                    margin="normal"
                    fullWidth
                    id="whiteRice"
                    name="whiteRice"
                    label="# White Rice"
                    onChange={handleChange}
                    value={formData.whiteRice}
                  />
                ) : (
                  ""
                )}
              </Box>
            </FormGroup>

            <FormGroup aria-label="position" row>
              <Box sx={{ display: "flex", flexDirection: "row" }}>
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={peanutButter}
                      id="peanutButter"
                      name="peanutButter"
                      onChange={handleChange}
                      // value={formData.firstName}
                    />
                  }
                  label="Peanut Butter"
                />
                {checked.whiteRice ? (
                  <TextField
                    margin="normal"
                    fullWidth
                    id="whiteRice"
                    name="whiteRice"
                    label="# White Rice"
                    onChange={handleChange}
                    value={formData.whiteRice}
                  />
                ) : (
                  ""
                )}
              </Box>
            </FormGroup>

            <FormControlLabel
              control={
                <Checkbox
                  checked={jelly}
                  id="jelly"
                  name="jelly"
                  onChange={handleChange}
                  // value={formData.firstName}
                />
              }
              label="Jelly"
            />
            <FormControlLabel
              control={
                <Checkbox
                  checked={tuna}
                  id="tuna"
                  name="tuna"
                  onChange={handleChange}
                  // value={formData.firstName}
                />
              }
              label="Tuna"
            />
            <FormControlLabel
              control={
                <Checkbox
                  checked={mayo}
                  id="mayo"
                  name="mayo"
                  onChange={handleChange}
                  // value={formData.firstName}
                />
              }
              label="Mayo"
            />
            <FormControlLabel
              control={
                <Checkbox
                  checked={cookies}
                  id="cookies"
                  name="cookies"
                  onChange={handleChange}
                  // value={formData.firstName}
                />
              }
              label="Cookies"
            />
            <FormControlLabel
              control={
                <Checkbox
                  checked={saltines}
                  id="saltines"
                  name="saltines"
                  onChange={handleChange}
                  // value={formData.firstName}
                />
              }
              label="Saltines Crackers"
            />
            <FormControlLabel
              control={
                <Checkbox
                  checked={jello}
                  id="jello"
                  name="jello"
                  onChange={handleChange}
                  // value={formData.firstName}
                />
              }
              label="Jello"
            />
            <Button fullWidth variant="contained" sx={{ mt: 3, mb: 2 }}>
              Submit
            </Button>
          </Box>
        </Box>
        <Copyright sx={{ mt: 8, mb: 4 }} />
      </Container>
    </ThemeProvider>
  );
}

export default NewOrderForm;
